class Solution(object):
    def minOperations(self, nums, target):
        """
        :type nums: List[int]
        :type target: int
        :rtype: int
        """
        freq = {}
        for num in nums:
            freq[num] = freq.get(num, 0) + 1

        if target in freq:
            return 0

        ops = 0
        for x in sorted(freq.keys(), reverse=True):
            if x == 1:
                break
            while freq[x] and target >= x:
                target -= x
                freq[x] -= 1
                freq[x // 2] += 2
                ops += 1
                if target in freq:
                    return ops
        return -1
